		StartGameAgainbtn.x = 300;
		StartGameAgainbtn.y = 550;
		finishScreen.addChild(StartGameAgainbtn);
		StartGameAgainbtn.addEventListener("click",secondGameFunc)
		
		var finishGamebtn = new lib.finishGamebtn();
		finishGamebtn.x = 600;
		finishGamebtn.y = 550;
		finishScreen.addChild(finishGamebtn);
